// Import the functions you need from the SDKs you need
import firebase from "firebase/compat/app";
import {getAuth,// authentication 설정
    signInWithPopup, //google 로그인을 팝업창에 띄우기 위해
    GoogleAuthProvider, //google login 기능
    signInWithEmailAndPassword,// email 로그인
    createUserWithEmailAndPassword} //email 회원가입}
 from "firebase/compat/auth";
// TODO: Add SDKs for Firebase products that you want to use
// https://firebase.google.com/docs/web/setup#available-libraries

// Your web app's Firebase configuration
const firebaseConfig = {
    apiKey: "AIzaSyAbee1yEAOq531rUmKPh4BwB9PFys58Exc",
    authDomain: "neighbe-test.firebaseapp.com",
    projectId: "neighbe-test",
    storageBucket: "neighbe-test.appspot.com",
    messagingSenderId: "409116785222",
    appId: "1:409116785222:web:262c92bddb863ee958a847"
};

// Initialize Firebase
const app = firebase.initializeApp(firebaseConfig);

const auth = getAuth();

export const signupEmail = (email, password) => {
    return createUserWithEmailAndPassword(auth, email, password);
};

export const loginEmail = (email, password) => {
    return signInWithEmailAndPassword(auth, email, password);
};
